import { useState } from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import TabPanel from './TabPanel';
import PriceTable from './NFTs/PriceTable';
import Sales from './Sales/Sales';
import Metamon from './Metamon/Metamon'
import Elemon from './Elemon/Elemon'
import '../App.css'

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}
const HeaderTabs = (props) => {

    const { match, history } = props;
    const { params } = match;
    const { page } = params;

    const tabNameToIndex = {
        0: "nfts",
        2: "sales",
        3: "metamon",
        4: "elemon",
    };

    const indexToTabName = {
        nfts: 0,
        sales: 1,
        metamon: 2,
        elemon: 3,
    };
    const [value, setValue] = useState(indexToTabName[page]);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };
    const handleCallToRouter = (value) => {
        // this.props.history.push(value);
    }
    return (
        <Box sx={{ width: '100%' }}>
            <Box id="tabs" sx={{ borderBottom: 1, borderColor: 'divider' }}>
                <Tabs value={value} sx={{ color: '#ffffff' }} onChange={handleChange} aria-label="basic tabs example">
                    <Tab label="NFTs" {...a11yProps(0)} />
                    <Tab label="Sales" {...a11yProps(1)} />
                    <Tab label="Metamon" {...a11yProps(2)} />
                    <Tab label="Elemon" {...a11yProps(3)} />
                </Tabs>
            </Box>
            <TabPanel value={value} index={0}>
                <PriceTable />
            </TabPanel>
            <TabPanel value={value} index={1}>
                <Sales />
            </TabPanel>
            <TabPanel value={value} index={2}>
                <Metamon />
            </TabPanel>
            <TabPanel value={value} index={3}>
                <Elemon />
            </TabPanel>
        </Box>
    );
}

export default HeaderTabs;
